import React from 'react';

export class TextField extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return (
            <section>
                <h4>What is your {this.props.name} ?</h4>
                <input name={this.props.name}  placeholder={this.props.name} type={this.props.type} placeholder={this.props.name} />
            </section>
        )
    }
}

export class TextArea extends React.Component{
    render(props){
        return (
            <section>
                <h4>{this.props.question}</h4>
                <textarea name="message" id="" cols="50" rows="10"></textarea>
            </section>
        )
    }
}
